South Park is an American animated sitcom created by Trey Parker and Matt Stone
for the Comedy Central television network. Intended for mature audiences, the
show has become famous for its crude language and dark, surreal humor that
lampoons a wide range of topics. The ongoing narrative revolves around four
boys - Stan Marsh, Kyle Broflovski, Eric Cartman and Kenny McCormick - and
their bizarre adventures in and around the titular Colorado town.

Produced by South Park Studios and Comedy Central.

